/*Table structure for table `c_game_platform` */

DROP TABLE IF EXISTS `c_game_platform`;

CREATE TABLE `c_game_platform` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `platform_name` varchar(255) DEFAULT NULL COMMENT '平台名称',
  `platform_remark` varchar(255) DEFAULT '这个用户很懒，什么都没有留下' COMMENT '备注',
