/*Table structure for table `c_payorder` */

DROP TABLE IF EXISTS `c_payorder`;

CREATE TABLE `c_payorder` (
  `order_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT NULL COMMENT '用户Id',
  `order_phone` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '打款人手机号码',
  `order_realname` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '打款人姓名',
  `order_no` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '订单号',
  `order_money` decimal(10,2) DEFAULT NULL COMMENT '打款金额',
  `order_recharge` decimal(10,2) DEFAULT NULL COMMENT '充值金额',
  `order_platform` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '游戏平台',
  `order_gamename` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '游戏名称',
  `order_adminNo` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '后台账号',
  `order_channel` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '渠道号',
  `order_time` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '下单时间',
  `order_operaname` varchar(20) COLLATE utf8_unicode_ci DEFAULT '未处理' COMMENT '处理人姓名',
  `order_operatime` varchar(20) COLLATE utf8_unicode_ci DEFAULT '未处理' COMMENT '处理时间',
  `order_status` enum('1','2') COLLATE utf8_unicode_ci DEFAULT '1' COMMENT '1:未处理   2:已处理',
  PRIMARY KEY (`order_id`)
) ENGINE=InnoDB AUTO_INCREMENT=37 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

